fun lengthOfLongestSubstring(s: String): Int {

    val hashMap = mutableMapOf<Char,Int>()
    var longest: Pair<Int,Int> = Pair(0,1)
    var start = 0

    for (i in s.indices){
        val letter = s[i]
        if (hashMap.containsKey(letter)){
            start = if(hashMap[letter]!! + 1 < start)  start else hashMap[letter]!! + 1
        }
        val (startIndex, endIndex) = longest
        if (endIndex - startIndex < i - start + 1){
            longest = Pair(start, i + 1)
        }

        hashMap[letter] = i
    }
    val (firstIndex, secondIndex) = longest
    return secondIndex - firstIndex
}